@import "tailwindcss";

@theme {
  --font-sans: "Nunito", sans-serif;

  --color-primary: #605BFF;
  --color-secondary: #FFB74D;
  --color-success: #00B69B;
  --color-danger: #EF3826;
  --color-dark: #202224;
  --color-light-bg: #F5F6FA;
  --color-border: #D5D5D5;
}

body {
  font-family: var(--font-sans);
  background-color: var(--color-light-bg);
  color: var(--color-dark);
}

import React from 'react';
import { NavLink } from 'react-router-dom';

const navItems = [
  { name: 'Dashboard', icon: 'dashboard.svg', path: '/' },
  { name: 'Analytics', icon: 'analytics.svg', path: '/analytics' },
  { name: 'Invoice', icon: 'invoice.svg', path: '/invoice' },
  { name: 'Schedule', icon: 'schedule.svg', path: '/schedule' },
  { name: 'Calendar', icon: 'calendar.svg', path: '/calendar' },
  { name: 'Messages', icon: 'messages.svg', path: '/messages' },
  { name: 'Notification', icon: 'notification.svg', path: '/notification' },
  { name: 'Settings', icon: 'settings.svg', path: '/settings' },
];

export const Sidebar: React.FC = () => {
  return (
    <div className="w-64 bg-white h-screen flex flex-col border-r border-gray-200">
      <div className="p-6 flex items-center justify-center">
        <img src="./assets/logo.svg" alt="Logo" className="h-10" />
      </div>

      <nav className="flex-1 px-4 space-y-2 mt-4">
        {navItems.map((item) => (
          <NavLink
            key={item.name}
            to={item.path}
            className={({ isActive }) =>
              `flex items-center gap-4 px-4 py-3 rounded-lg transition-colors duration-150 ${
                isActive
                  ? 'bg-primary text-white'
                  : 'text-gray-500 hover:bg-gray-50'
              }`
            }
          >
            {({ isActive }) => (
              <>
                 {/* Filter usually not needed for SVG if we control color via CSS, 
                     but since we use img tags, we might need a filter or use mask.
                     However, the design shows colored icons. 
                     The exported SVGs might be hardcoded color. 
                     Let's check if they are monochrome or colored. 
                     Assuming they have colors matching the design state (mostly gray/black).
                     For active state, we might need to filter them to white.
                  */}
                <img 
                    src={`./assets/icons/${item.icon}`} 
                    alt={item.name} 
                    className={`w-5 h-5 ${isActive ? 'brightness-0 invert' : ''}`} 
                />
                <span className="font-semibold">{item.name}</span>
              </>
            )}
          </NavLink>
        ))}
      </nav>

      {/* Upgrade Promo */}
      <div className="px-6 pb-6">
         {/* Placeholder for Upgrade Card */}
         <div className="bg-blue-500 rounded-2xl p-4 text-center text-white relative overflow-hidden">
            <div className="text-xs opacity-80 mb-2">Upgrade to Pro</div>
            <div className="font-bold text-sm mb-4">Get all features</div>
             <button className="bg-white text-blue-500 text-xs font-bold py-2 px-4 rounded-full w-full">
               Upgrade Now
             </button>
         </div>
      </div>

      <div className="p-4 border-t border-gray-100">
        <button className="flex items-center gap-3 px-4 py-2 w-full text-gray-500 hover:text-gray-700">
           {/* Logout icon logic or static */}
           <span className="font-semibold text-sm">Log Out</span>
        </button>
      </div>
    </div>
  );
};

import React from 'react';
import { Sidebar } from './Sidebar';

interface LayoutProps {
  children: React.ReactNode;
}

export const Layout: React.FC<LayoutProps> = ({ children }) => {
  return (
    <div className="flex min-h-screen bg-gray-50">
      <Sidebar />
      <main className="flex-1 overflow-auto">
        <header className="bg-white h-20 px-8 flex items-center justify-between sticky top-0 z-10">
          <h1 className="text-3xl font-bold text-dark">Dashboard</h1>

          <div className="flex items-center gap-6">
            <div className="relative">
                <input 
                    type="text" 
                    placeholder="Search..." 
                    className="bg-gray-100 px-4 py-2 rounded-lg pl-10 text-sm focus:outline-none focus:ring-2 focus:ring-primary/20"
                />
                 {/* Search Icon placeholder */}
                <span className="absolute left-3 top-2.5 text-gray-400">🔍</span>
            </div>

             {/* Notification & User Profile placeholders */}
             <div className="w-10 h-10 bg-gray-200 rounded-full"></div>
             <div className="flex items-center gap-2">
                <div className="w-10 h-10 bg-gray-300 rounded-full"></div>
                <div>
                    <div className="text-sm font-bold">User Name</div>
                    <div className="text-xs text-gray-500">Admin</div>
                </div>
             </div>
          </div>
        </header>
        <div className="p-8">
          {children}
        </div>
      </main>
    </div>
  );
};

import { Routes, Route } from 'react-router-dom';
import { Layout } from './components/layout/Layout';
import { Dashboard } from './pages/Dashboard';

function App() {
  return (
    <Layout>
      <Routes>
        <Route path="/" element={<Dashboard />} />
        {/* Placeholder routes for other links */}
        <Route path="*" element={<div className="p-4">Page under construction</div>} />
      </Routes>
    </Layout>
  );
}

export default App;

