import React from 'react';
import { AreaChart, Area, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer, PieChart, Pie, Cell } from 'recharts';

const stats = [
  { label: 'Total User', value: '40,689', change: '8.5%', trend: 'up' },
  { label: 'Total Order', value: '10,293', change: '1.3%', trend: 'up' },
  { label: 'Total Sales', value: '$89,000', change: '4.3%', trend: 'down' },
  { label: 'Total Pending', value: '2,040', change: '1.8%', trend: 'up' }
];

const chartData = [
  { name: '5k', uv: 4000, pv: 2400, amt: 2400 },
  { name: '10k', uv: 3000, pv: 1398, amt: 2210 },
  { name: '15k', uv: 2000, pv: 9800, amt: 2290 },
  { name: '20k', uv: 2780, pv: 3908, amt: 2000 },
