  { name: '30k', uv: 2390, pv: 3800, amt: 2500 },
  { name: '35k', uv: 3490, pv: 4300, amt: 2100 },
];

const pieData = [
  { name: 'Sale', value: 400 },
  { name: 'Distribute', value: 300 },
  { name: 'Return', value: 300 },
];
const COLORS = ['#605BFF', '#FFB74D', '#FF5B5B'];

const recentOrders = [
    { id: '#876364', name: 'Camera Lens', price: '$178', status: 'Delivered' },
    { id: '#876368', name: 'Black Sleep Dress', price: '$14', status: 'Delivered' },
