                    <tr className="text-left text-gray-400 text-sm border-b border-gray-100">
                        <th className="pb-4 font-semibold">Tracking ID</th>
                        <th className="pb-4 font-semibold">Product Name</th>
                        <th className="pb-4 font-semibold">Price</th>
                        <th className="pb-4 font-semibold">Status</th>
                    </tr>
                </thead>
                <tbody className="text-sm font-semibold">
                     {recentOrders.map((order, i) => (
                         <tr key={i} className="border-b border-gray-50 last:border-0 hover:bg-gray-50 transition-colors">
                             <td className="py-4 text-dark">{order.id}</td>
                             <td className="py-4 text-dark flex items-center gap-2">
                                <div className="w-8 h-8 bg-gray-100 rounded-lg"></div>
                                {order.name}
                             </td>
                             <td className="py-4 text-dark">{order.price}</td>
                             <td className="py-4">
                                <span className={`px-3 py-1 rounded-full text-xs ${
                                    order.status === 'Delivered' 
                                        ? 'text-green-500 bg-green-50' 
                                        : 'text-orange-500 bg-orange-50'
                                }`}>
                                    {order.status}
                                </span>
                             </td>
                         </tr>
                     ))}
                </tbody>
            </table>
         </div>
         <div className="col-span-1 bg-white p-6 rounded-2xl shadow-sm border border-gray-100">
            <h3 className="text-xl font-bold mb-6 text-dark">Top Selling Products</h3>
            <div className="space-y-4">
                {[1,2,3].map(i => (
                    <div key={i} className="flex items-center gap-4 border-b border-gray-50 pb-4 last:border-0 last:pb-0">
                        <div className="w-16 h-16 bg-gray-100 rounded-xl">
                            {/* Product Image Placeholder */}
                        </div>
                        <div className="flex-1">
                            <div className="font-bold text-dark">Nike Sport Shoe</div>
                            <div className="text-xs text-gray-400 mt-1">4 stars</div>
                        </div>
                        <div className="font-bold text-dark">$80</div>
                    </div>
                ))}
            </div>
         </div>
      </div>
    </div>
  );
};
